function [fitresult, gof] = ScanlanFit(ex, epsx)
%CREATEFIT(EX,EPSX)
%  Create a fit.
%
%  Data for 'ScanlanModel' fit:
%      X Input : ex
%      Y Output: epsx
%  Output:
