%% Fit: 'ScanlanModel'.
[xData, yData] = prepareCurveData( ex, epsx );

% Set up fittype and options.
ft = fittype( 'a+b*x^2', 'independent', 'x', 'dependent', 'y' );
% a=rho*U*D*Y1/(-2*m*w0);b=-rho*U*D*Y1*epsilon/4/(-2*m*w0);
